import { withTheme } from '@emotion/react';
import styled from '@emotion/styled';
import { FC } from 'react';
import { StaticPageKey } from '../../../constants';
import { getMediaQuery } from '@portfolio-2022/utils';

const Root = withTheme(
  styled.div(({ theme }) => ({
    position: 'absolute',
    top: '50%',
    left: '50%',
    width: '80vw',
    paddingBottom: '30vw',
    transform: 'translate(-50%, -50%)',
    zIndex: theme.zIndexes.low,
    svg: {
      position: 'absolute',
      inset: 0,
      width: '100%',
      height: '100%',
      color: theme.colorPalettes.white,
    },
    [getMediaQuery('lg')]: {
      width: '40rem',
    },
  })),
);

interface SVGTextProps {
  page: StaticPageKey;
}

export const SVGText: FC<SVGTextProps> = (props) => {
  const { page } = props;

  return (
    <Root>
      {(() => {
        switch (page) {
          case 'about':
            return <AboutSVGText />;
          case 'contact':
            return <ContactSVGText />;
          case 'works':
            return <WorksSVGText />;
          default:
            throw new Error('Invalid page key');
        }
      })()}
    </Root>
  );
};
SVGText.displayName = 'SVGText';

